import React, { useState } from "react";
import ReactStoreIndicator from "react-score-indicator";
import { Button } from "./Style";

export const Score = () => {
  const [clicks, setClicks] = useState(20);
  return (<ReactStoreIndicator
    value={clicks}
    maxValue={100}
    lineWidth={15}
    lineGap={3}
    fadedOpacity={20}
  />)(<Button buttonColor="green" onclick={setClicks(clicks + 1)}></Button>);
};
